import logo from './logo.svg';
import './App.css';
import {useEffect, useState} from "react";
import Axios from "axios";


function App() {
    const [message, setMessage] = useState("");
    useEffect(()=> {
        Axios.get("/home")
            .then((res)=>{
                if (res.data) {
                    console.log(res.data);
                    setMessage(res.data);
                } else {
                    alert("failed to ");
                }
            })
            .catch(e => {
                alert("error")
            })
    },[]);


    return (
        <div className="App">
            {console.log(message)}
        </div>
    );
}

export default App;
